import axios from "axios";
export default {
  name: "AboutView",
  data() {
    return {
      tags: [],
      create: ''
    };
  },
  methods: {
    async fetchTags() {
      await axios.get('http://localhost:9090/specialitylookup-all').then(response => {
        let createArr = [{
          specialityName: "create",
          tags: ['create']
        }];
        this.tags = this.chunk([...createArr, ...response.data.reverse()], 3);
      });
    }
  }
};
